import { combineReducers } from 'redux'

const videoReducer = combineReducers({
  byId: videosById,
  allIds: allVideos
})

export default videoReducer

function videosById(state = {}, action) {
  switch(action.type) {

    default:
      return state
  }
}


function allVideos(state = [], action) {

  switch(action.type) {

